import { TestImg } from "../../assets"

export const LAYOUT3_TEST = {
    header: 'Hello World',
    subheader: 'My name is Layout 3',
    people: [
        {
            img : TestImg,
            name: "Person 1",
            occupation: "Chef"
        },
        {
            name: "Person 1",
        },
        {
            occupation: "Officer",
        }

    ]
}
